import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Carros } from '../carros';
import { CarrosService } from '../carros.service';

@Component({
  selector: 'app-confirmar-interesse',
  templateUrl: './confirmar-interesse.component.html',
  styleUrls: ['./confirmar-interesse.component.css']
})
export class ConfirmarInteresseComponent {

  id!: number;
  carros!: Carros;
  constructor(private route: ActivatedRoute, private carrosService: CarrosService) { }

   ngOnInit(): void {
    this.id = this.route.snapshot.params['id'];

     this.carros = new Carros();
     this.carrosService.getCarrosByid(this.id).subscribe( data => {
       this.carros = data;
     })
 }
 }
